import { TextField } from "@mui/material";
import "./Signin.css"
const Signin = () => {


  return (
    <div className="user_info">

        <div classname="e-post">
          <b>E-Posta</b>
          <input />
          <TextField></TextField>
        </div>

        <div className="password">
          <b>Şifre</b>
          <input />
        </div>
        <button>Giriş Yap</button>
    </div>
  );
};
export default Signin;
